import React from 'react'
import { Table, Tag, Space } from 'antd';
export default function AdDevices() {
    const columns = [
        {
            title: 'ID',
            dataIndex: 'ID',
            key: 'ID',
            render: text => <a>{text}</a>,
        },
        {
            title: 'Name',
            dataIndex: 'Name',
            key: 'Name',
        },
        {
            title: 'Type',
            dataIndex: 'Type',
            key: 'Type',
        },
        {
            title: 'Status',
            key: 'Status',
            dataIndex: 'Status',
            render: Status => (
                <>
                    {Status.map(tag => {
                        let color = tag.length > 6 ? 'charteuse' : 'volcano';
                        return (
                            <Tag color={color} key={tag}>
                                {tag.toUpperCase()}
                            </Tag>
                        );
                    })}
                </>
            ),
        },
        {
            title: 'Action',
            key: 'action',
            render: (text, record) => (
                <Space size="middle">
                    <a>View Detail</a>
                </Space>
            ),
        },
    ];
    const data = [
        {
            key: '1',
            ID: 'DV1',
            Name: 'DMS_Devices 1',
            Type: 'PC',
            Status: ['Avaiable'],
        },
        {
            key: '1',
            ID: 'DV1',
            Name: 'DMS_Devices 1',
            Type: 'PC',
            Status: ['Avaiable'],
        }, {
            key: '1',
            ID: 'DV1',
            Name: 'DMS_Devices 1',
            Type: 'PC',
            Status: ['closer'],
        }, {
            key: '1',
            ID: 'DV1',
            Name: 'DMS_Devices 1',
            Type: 'PC',
            Status: ['Avaiable'],
        }, {
            key: '1',
            ID: 'DV1',
            Name: 'DMS_Devices 1',
            Type: 'PC',
            Status: ['Avaiable'],
        }
    ];
    return (
        <Table columns={columns} dataSource={data} />
    )
}
